import React from 'react'
import SeasonCard from "./SeasonCard";
import Navbar from "../Navbar/Navbar";
import SeasonTab from "./SeasonTab";

class AllSeasonsList extends React.Component {
  render() {
    return(
      <div>
        <Navbar />
        <div className="container">
          <h3 className="indigo-text text-darken-4 darken">All Seasons</h3>
          <div className="divider"></div>


          <div className="row center">
            <div className="col l12 m12 s12">
              <ul className="tabs center-align">
                <SeasonTab Season_Id={9} Season_Year={2016} />
                <SeasonTab Season_Id={8} Season_Year={2015} />
                <SeasonTab Season_Id={7} Season_Year={2014} />
                <SeasonTab Season_Id={6} Season_Year={2013} />
                <SeasonTab Season_Id={5} Season_Year={2012} />
                <SeasonTab Season_Id={4} Season_Year={2011} />
                <SeasonTab Season_Id={3} Season_Year={2010} />
                <SeasonTab Season_Id={2} Season_Year={2009} />
                <SeasonTab Season_Id={1} Season_Year={2008} />
              </ul>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
export default AllSeasonsList;
